import React from 'react';
import Baner from './Baner/Baner';
import Board from './Board/Board';
import {board} from '../../data/imageData';

var counter = 0;


setTimeout(() => {
   counter = counter + 1;
}, 1000);


const GameWrapper = () => (
    <div>
        <Baner />
        <Board 
            desc = {board[1].description}
            img = {board[1].image}
        />
    </div>
);

export default GameWrapper;
